import React from "react";

import portfolioList from ".";

const Portfolio = () => {
        
    return (
        // Single project component goes here
        <section>
            <h1>Portfolio</h1>
            <div id="projectCards">
                {projectList.map(project => (
                    <Project project={project}
                    />
                ))}
            </div>
        </section>
    )
};

export default Portfolio;
